import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const MyInfo = () => {
    return (
        <div>
            <h1>Babajide</h1>
            <p>I am the best</p>
            <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
            </ul>
        </div>
    )
};

ReactDOM.render(<MyInfo />, document.getElementById("root"));
